import React from 'react';
import { Link } from 'react-router-dom';


const Header = () => {
	return(
		<div className="main-container">
			<div className="dropdown menu">
				<Link to="/" className="item">
					News
				</Link>
				<Link to="/about" className="item">
					About
				</Link>
			</div>
		</div>
	);
};

export default Header;
